import React from 'react';

const resposta = {
  data: ['This', 'is', 'a', 'map']
}

class EasyMap extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      lista: [],
    };
    this.mapGenerate = this.mapGenerate.bind(this);
  }

  mapGenerate() {
    this.setState({
      lista: resposta.data,
    });
    return (
      this.state.lista.map(index => <p>{index}</p>)
    );
  }

  render() {
    return (
      <div>
        <mapGenerate />
      </div>
    );
  }
}

export default EasyMap;
